import React from 'react'
import ReactDOM from 'react-dom'

class PracticalExperience extends React.Component {
    constructor () {
        super()

        this.State = {
            companyName: { text: '' },
            positionTitle: { text: '' },
            startDate: { text: '' },
            endDate: { text: '' },
        };
    };

    getCompanyName = (e) => {
        this.setState({
            companyName: {
                text: e.target.value
            }
        });
    };

    getPositionTitle = (e) => {
        this.setState({
            positionTitle: {
                text: e.target.value
            }
        });
    };

    getStartDate = (e) => {
        this.setState({
            startDate: {
                text: e.target.value
            }
        });
    };

    getEndDate = (e) => {
        this.setState({
            endDate: {
                text: e.target.value
            }
        });
    };

    onSubmitInfo = (e) => {
        e.preventDefault();
        this.setState({
            companyName: { text: '' },
            positionTitle: { text: '' },
            startDate: { text: '' },
            endDate: { text: '' },
        });
    };

    render() {
        return (
            <div>
                <h2>Practical Experience</h2>
                <form>
                    <label htmlFor="companyName">Company Name</label>
                        <input type="text" id="companyName"></input>
                        <br></br>
                    <label htmlFor="positionTitle">Position Title</label>
                        <input type="text" id="positionTitle"></input>
                        <br></br>
                    <label htmlFor="startDate">Start date of working</label>
                        <input type="date" id="startDate"></input>
                        <br></br>
                    <label htmlFor="endDate">End date of working</label>
                        <input type="date" id="endDate"></input>
                        <br></br>
                    <button type="submit">
                        Submit Practical Experience
                    </button>
                    <button type="submit">
                        Edit Practical experience
                    </button>
                </form>
            </div>
        )
    }
}

export default PracticalExperience;
